import { FiSearch } from "react-icons/fi";
import { RiMenu5Fill } from "react-icons/ri";

import Button from "./UI/Button";

function NavBar() {
	return (
		<div className="flex justify-between shadow-md border-black py-1 px-15 items-center">
			<div className="border">
				<img src="/static/images/BlogPost4.png" alt="Blog Post" className="w-4" />
			</div>
			<div className="invisible md:visible md:flex justify-between items-center w-72">
				<h1>Blog</h1>
				<h1>About</h1>
				<FiSearch size={24} className="cursor-pointer" />
				<Button text={'Contact Us'} />
			</div>
			<div>
				<RiMenu5Fill size={25} />
			</div>
		</div>
	)
}

export default NavBar;
